import { Dialog ,withStyles} from "@material-ui/core";

const style={
    dialogPaper:{
        height:'95%',
        width:'60%',
        marginTop:'12%',
        boxShadow:'none'
    }
}
const Login=({classes})=>{
    return(
        <Dialog open={true} classes={{paper:classes.dialogPaper}}>
                Hello
        </Dialog>
    )
}
export default withStyles(style)(Login);
